import React from 'react';
import "./AdminPanel.css";
import Tab from "./Components/Tab/Tab";

const AdminPanel = () => {
    return (
        <div className="AdminPanel">

            <h2>Метрики</h2>
            <div className="metrics-block">

            <Tab
                title="Людей на сайте"
                isInteractive={false}
                count={324}
            />


            <Tab
                title="Онлайн за 24 часа"
                isInteractive={false}
                count={3235}
            />
            </div>

            <h2>Меню</h2>
            <div className="menu">
                <Tab
                    title="Расписание"
                    isInteractive={true}
                    changeDate={"12.12.12"}
                    changeTime={"12:12"}
                    changedUser={"И.И.Бебрик"}
                    link="/schedule/edit"
                    buttonContent={"Изменить"}
                />

                <Tab
                    title="Преподаватели"
                    isInteractive={true}
                    changeDate={"12.12.12"}
                    changeTime={"12:12"}
                    changedUser={"И.И.Бебрик"}
                    buttonContent={"Изменить"}
                />

                <Tab
                    title="Студенты"
                    isInteractive={true}
                    changeDate={"12.12.12"}
                    changeTime={"12:12"}
                    changedUser={"И.И.Бебрик"}
                    buttonContent={"Изменить"}
                />

                <Tab
                    title="Абитуриенты"
                    isInteractive={true}
                    changeDate={"12.12.12"}
                    changeTime={"12:12"}
                    buttonContent={"Изменить"}
                />
            </div>
        </div>
    );
};

export default AdminPanel;
